import { Component } from 'react';
import './Destination.css'
import aboutimage2 from '../assests/aboutimage2.jpg'

class Destination extends Component{
    render(){
        return(
            <div className="first-des">
            <h2>:</h2>
            <p>``TAKING PICTURES IS SAVORINGLIFE INTENSELY,
               EVERY HUNDREDTH OF A SECOND PHOTOGRAPHY IS A
               PICTURE PAINTED BY THE SUN WITHOUT INSTRUCTION IN ART``</p>
               <br/>
               <div className="image">
            <img alt="img" src={aboutimage2}/>
            </div>
            </div>
        )
    }
}
export default Destination;
